import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div>
          <button>Click me</button>
          <TouchableOpacity>Click me</TouchableOpacity>
        </div>
      </header>
    </div>
  );
}

export default App;
